import React  from 'react';
import './App.css';
import CreatureCard from './Components/CreatureCard'
import fishJSON from './CreaturesJSON/FishJSON';


const fishList = [...fishJSON];


class App extends React.Component {
  state = {
      fishToShow: fishList
  }

    render() {
        let fishToShow = [];

        return (
            <div
            style={{ 
                display: "flex",
                flexWrap: "wrap"

            }}>
              {fishList.map(fishy => 
                <CreatureCard name={fishy.name} location={fishy.location} price={fishy.price} />)}
            </div>
        )

    }
}




export default App
